@everyone **If you are using Ledger, please note!**
It is strongly recommend that you do **not** connect your Ledger device to anything for at least today.  Double-check with **official Ledger communication methods and website** before doing anything with Ledger!

This is Ledger's official Twitter/X account (but you can also get to this from the support section of Ledger's official website): https://twitter.com/Ledger
